import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
export default function AddEvent(){
    const navigate = useNavigate();
    const [date, setDate] = useState('');
    const [name, setName] = useState('');
    const [time, setTime] = useState('');
    const [category, setCategory] = useState('');
    const [numVol, setNumVol] = useState('');
    const [location, setLocation] = useState('');
    const [error, setError] = useState('');

    const handleAllEvent = () => {
        navigate('/allevents')
    }

    const handleAssignment = () => {
        //volunteer assignment api
    } 

    const handleSubmit = (event) => {
        event.preventDefault();
        if (date === ''){
            setError('Invalid Email')
        }
        else if (name === ''){
            setError('Invalid Name')
        }
        else if (time === ''){
            setError('Invalid Time')
        }
        else if (category === ''){
            setError('Invalid Position')
        }
        else if (numVol === ''){
            setError('Invalid Position')
        }
        else if (location === ''){
            setError('Invalid Position')
        }
        else{
            navigate('/allevents')
        }
    }

    return(
        <div style={{textAlign: 'center', display: 'flex', justifyContent: 'center', backgroundColor: '#CCCCFF', height: '120vh'}}>
            <div className='form-div' style={{ border: '1px solid black', padding: '20px', marginTop: '8%', height: '50%', width: '40%', backgroundColor: 'white', color: 'black'}}>
            <h1>Add Event</h1>
            <hr />
            <form onSubmit={handleSubmit}>
                <label>
                <p>Name <input type="text" onChange={e => setName(e.target.value)} /></p>
                </label>
                <label>
                <p>Date <input type="date" onChange={e => setDate(e.target.value)} /></p>
                </label>
                <label>
                <p>Time <input type="time" onChange={e => setTime(e.target.value)} /></p>
                </label>
                <label>
                <p>Event category <input type="text" onChange={e => setCategory(e.target.value)} /></p>
                </label>
                <label>
                <p>No. of Volunteers Required <input type="number" onChange={e => setNumVol(e.target.value)} /></p>
                </label>
                <label>
                <p>Location <input type="text" onChange={e => setLocation(e.target.value)} /></p>
                </label>
                <div>
                <button type="submit">Submit</button>
                </div>
                <br />
                {error && <div>{error}</div>}
                <div>
                    <button style ={{backgroundColor: '#CCCCFF', display:'inline-block', boxShadow: '0px 2px 2px lightgray', border: '1px solid black'}} onClick={handleAllEvent}>Back to Events List</button>
                    <button style ={{backgroundColor: '#CCCCFF', display:'inline-block', boxShadow: '0px 2px 2px lightgray', border: '1px solid black', marginLeft: '2%'}} onClick={handleAssignment}>Assign Volunteers</button>
                </div>
            </form>
            </div>
        </div>
    );
}
